const RegistrationWithCheckBox = ({
  inputWithRadioButton,
  onInputChange,
  ...props
}) => {
  debugger;
  return (
    <div>
      <div>
        {Object.keys(inputWithRadioButton).map((lable, index) => {
          return (
            <div>
              <label>{lable}</label>
              {inputWithRadioButton.gender.map(value => {
                return (
                  <div>
                    <lable>{value}</lable>
                    <input
                      type="radio"
                      value={value}
                      name={lable}
                      onChange={onInputChange}
                    />
                  </div>
                );
              })}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithCheckBox;
